item.solution:
#include<iostream>
#include<cstring>
using namespace std;
string m="",k,c;
int t;
int main()
{
    cin >> k >> c;
    while(k.size()<c.size())
      k=k+k;
    for(int i=0;i<=c.size()-1;i++)
    {
      if('A'<=k[i]&&'Z'>=k[i]) t=k[i]-'A';
      if('a'<=k[i]&&'z'>=k[i]) t=k[i]-'a';
      if('A'<=c[i]&&'Z'>=c[i]) m+=((char)(c[i]-'A'-t+26)%26+'A');
      if('a'<=c[i]&&'z'>=c[i]) m+=((char)(c[i]-'a'-t+26)%26+'a');
    }
    cout << m;
    return 0;
}

program vigenere;
var
  k,c:ansistring;
  lenk,lenc,i,t,x,y,f:longint;
  b:array[1..2000]of boolean;
  ch:char;
begin
  readln(k);
  readln(c);
  lenk:=length(k);
  lenc:=length(c);
  fillchar(b,sizeof(b),false);
  for i:=1 to lenc do
    if c[i] in ['a'..'z'] then
      b[i]:=true;
  f:=0;
  k:=upcase(k);
  c:=upcase(c);
  for i:=1 to lenc do
  begin
    f:=f+1;
    x:=ord(c[i]);
    if f>lenk then f:=1;
    y:=ord(k[f]);
    t:=x-(y-ord('A'));
    if t<ord('A') then t:=t+26;
    ch:=chr(t);
    if b[i] then write(chr(ord(ch)+32))
      else write(ch);
  end;
  writeln;
end.
